-- Table structure for table `requests`
--

DROP TABLE IF EXISTS `requests`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `requests` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `request_no` char(12) DEFAULT NULL,
  `offer_date` datetime DEFAULT NULL,
  `status` int(3) DEFAULT NULL,
  `user_kana` varchar(255) DEFAULT NULL,
  `user_name` varchar(255) DEFAULT NULL,
  `user_addr` varchar(255) DEFAULT NULL,
  `user_tel` varchar(14) DEFAULT NULL,
  `user_mobile` varchar(14) DEFAULT NULL,
  `lodging_place_name` varchar(255) DEFAULT NULL,
  `lodging_place_addr` varchar(255) DEFAULT NULL,
  `lodging_place_tel` varchar(14) DEFAULT NULL,
  `lodging_place_staff_name` varchar(14) DEFAULT NULL,
  `contractor_receive_addr` varchar(255) DEFAULT NULL,
  `travel_agent_name` varchar(255) DEFAULT NULL,
  `subscriber_name` varchar(255) DEFAULT NULL,
  `is_acceptable` char(1) DEFAULT NULL COMMENT '1：済、0：未',
  `is_past_setting` char(1) DEFAULT NULL COMMENT '1：有、0：無',
  `past_setting_year` char(4) DEFAULT NULL,
  `past_setting_month` char(2) DEFAULT NULL,
  `stay_from_date` datetime DEFAULT NULL,
  `stay_to_date` datetime DEFAULT NULL,
  `pre_instalation_date` datetime DEFAULT NULL COMMENT '設置希望日',
  `pre_instalation_time` char(10) DEFAULT NULL COMMENT '設置希望時',
  `pick_up_date` datetime DEFAULT NULL COMMENT '引取希望日',
  `pick_up_time` char(10) DEFAULT NULL COMMENT '引取希望時',
  `person_in_charge` varchar(255) DEFAULT NULL COMMENT '依頼会社担当者',
  `request_for_setting_date` datetime DEFAULT NULL,
  `is_before_setting` char(1) DEFAULT NULL COMMENT '1：可、0：否、2:可(フロント預かり)',
  `is_after_collectable` char(1) DEFAULT NULL COMMENT '1：可、0：否、2:可(フロント預かり)',
  `request_branch_code` char(10) DEFAULT NULL,
  `request_branch_staff_name` varchar(255) DEFAULT NULL,
  `request_company_code` char(10) DEFAULT NULL,
  `request_company_staff_name` varchar(255) DEFAULT NULL,
  `is_approval` tinyint(1) DEFAULT NULL COMMENT '1：済、0：未',
  `hospital_name` varchar(255) DEFAULT NULL,
  `doctor_name` varchar(255) DEFAULT NULL,
  `is_ventilator` char(1) DEFAULT NULL COMMENT '1:併用する、0:併用しない',
  `ventilator_name` varchar(255) DEFAULT NULL,
  `is_ventilator_joint` char(1) DEFAULT NULL COMMENT '1:あり、0:なし',
  `at_rest` char(10) DEFAULT NULL COMMENT '安静時流量 L/min',
  `rest_hour` char(10) DEFAULT NULL COMMENT '安静時流量 時間',
  `during_exercise` char(10) DEFAULT NULL COMMENT '運動時流量 L/min',
  `exercise_hour` char(10) DEFAULT NULL COMMENT '運動時流量 時間',
  `at_bedtime` char(10) DEFAULT NULL COMMENT '就寝時流量 L/min',
  `bedtime_hour` char(10) DEFAULT NULL COMMENT '就寝時流量 時間',
  `request_message` text,
  `temporary_saving_flg` char(1) DEFAULT NULL COMMENT '1:一時保存中、0:登録完了',
  `cancel_flg` char(1) DEFAULT NULL COMMENT '1:キャンセル、0:',
  `machine_type` char(1) DEFAULT NULL COMMENT '1：酸素濃縮器、2：液体酸素、3：ボンベ、4：酸素濃縮器+ボンベ、5：液体酸素+ボンベ',
  `file` text COMMENT '添付ファイル名',
  `contractor_branch_code` char(10) DEFAULT NULL,
  `contractor_branch_staff_name` varchar(255) DEFAULT NULL,
  `contractor_company_code` char(10) DEFAULT NULL,
  `request_charge` decimal(10,0) DEFAULT NULL,
  `request_charge_tax` decimal(10,0) DEFAULT NULL,
  `contractor_charge` decimal(10,0) DEFAULT NULL,
  `contractor_charge_tax` decimal(10,0) DEFAULT NULL,
  `contractor_payment` decimal(10,0) DEFAULT NULL,
  `contractor_payment_tax` decimal(10,0) DEFAULT NULL,
  `executive_commission` decimal(10,0) DEFAULT NULL,
  `executive_commission_tax` decimal(10,0) DEFAULT NULL,
  `is_charge_completed` char(1) DEFAULT '0',
  `is_payment_completed` char(1) DEFAULT '0',
  `is_bill_received` char(1) DEFAULT '0',
  `is_bill_receive_completed` char(1) DEFAULT '0',
  `bill_receive_date` datetime DEFAULT NULL,
  `issue_of_bill_date` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `updated_by` char(36) DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `created_by` char(36) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=418 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

